@A-1DMのDMコード６桁目は、営業系DM区分='X','J',L','S','V','R','K','G', '1','2', '3','4' )の場合、'1'をセット
Aその他は '0'をセット
※営業系DM区分は、汎用コードマスタで管理する。

@追求DM履歴作成候補データのDMコード６桁目は、営業系DM区分='X','J',L','S','V','R','K','G', '1','2', '3','4' )の場合、'1'をセット
Aその他は '0'をセット
※営業系DM区分は、汎用コードマスタで管理する。

処理2.1のカウント処理対象の判定結果により、
@カウント処理対象の場合、「1：作成済」を設定
Aそれ以外は、「9：作成対象外」を設定

処理3.1の再局出対象判定処理の判定結果より、
@再局出対象の場合、「1：作成済」を設定
Aそれ以外は、「9：作成対象外」を設定
